import classes from './Hero.module.css'
import fadeout from '../../img/hero-soil-fadeout.png'


function Hero() {
    return (
        <div className={classes.title}>
            <h1>HEALING OUR SOIL</h1><br/>
            <h1>PRESERVING OUR STORIES</h1>
            <img src={fadeout} className={fadeout}></img>
        </div>

    )
}

export default Hero;
